import React, { Component } from 'react';
import './App.css';

class App extends Component {

  render() {
    const style = {
    'backgroundImage': 'linear-gradient(rgba(0, 0, 0, 0.8), rgba(0, 0, 0, 0.8)),url(/assets/budget.jpg)',
    'backgroundSize': 'cover',
    'height': '100vh'
  }

  return (
    <div className="App" style={style}>
      <h1>Available Budget on march 2021</h1>
    </div>
  );
  }

}

export default App;
